import React, { useState } from "react";
import Icon from "react-native-vector-icons/AntDesign" 
import { SafeAreaView, View, Text, ScrollView, StyleSheet, TouchableOpacity, TextInput } from "react-native";
import {  

} from "../componenets/fintech2Style"
import { 
    FirstView1, 
    BigText1,
    SecondView1

} from "../componenets/fintech2Style";

export default function Fintech2(){
    return(
        <SafeAreaView style={styles.fintech2container}>
            <ScrollView>
                <FirstView1>
                   <Icon size={20} color="#CDA360" name="back" style={styles.pad1}/> 
                   <BigText1 style={styles.pad}>Procurement</BigText1>
                </FirstView1>
                <SecondView1>
                    <TextInput 
                    style={styles.input}
                    placeholder="Paste Link"
                    />
                </SecondView1>
            </ScrollView>
        </SafeAreaView>
    )
}

const styles = StyleSheet.create({
    fintech2container: {
        backgroundColor: "#000",
        paddingTop: 25,
        flex: 1,
    },
    pad: {
        paddingLeft: 69,
    },
    pad1: {
        paddingLeft: 40
    },
    input: {
        backgroundColor: "#4E4E4E",
        width: 320,
        height: 48,
        borderRadius: 100,
        flexDirection: "row",
        paddingLeft: 20,
        color: "#fff"   
    }

})
